import React, { Component } from 'react';
import '../css/AppHeader.css';

class AppHeader extends Component {

    render() {
        return (
            <div id="menu_top">
                <ul>
                    <li><a href="SignIn" title="Đăng xuất" className="active">{" "}Đăng xuất{" "}</a></li>
                    <li><a href="Home" title="Trang chủ">{" "}Trang chủ{" "}</a></li>
                    <li><a href="Profile" title="Thông tin cá nhân">{" "}Thông tin cá nhân</a></li>
                    <li><a href="Introduction" title="Giới thiệu">{" "}Giới thiệu</a></li>
                    <li><a href="Huongdan" title="Hướng dẫn">{" "}Hướng dẫn</a></li>
                    <li><a href="Bangchamcode" title="Bảng chấm code">{" "}Bài kiểm tra</a></li>
                    <li><a href="HocC" title="Học C">{" "}Học C</a></li>
                    <li><a href="Diem" title="Điểm">{" "}Điểm</a></li>
                    {/* <div className="search-container">
                        <form action="/action_page.php">
                            <button type="submit">Tìm</button>
                            <input type="text" placeholder="Tìm kiếm..." name="search" />
                        </form>
                    </div> */}
                </ul>
            </div>
        );
    }
}

export default AppHeader;
